webpackJsonp([160],{"./node_modules/json-loader/index.js!./.cache/json/articles-python-python-powxy.json":function(e,o){e.exports={data:{markdownRemark:{html:'<p><code>pow(x, y[, z])</code> is a built-in function in Python 3 to calculate <code>x</code> to the power <code>y</code> and if <code>z</code> is present , returns <code>x</code> to the power <code>y</code> <a href="https://processing.org/reference/modulo.html">modulo</a> <code>z</code></p>\n<h2>Arguments</h2>\n<p>The arguments must have numeric types.<br>\nThis function takes two arguments, <code>x</code> and <code>y</code>, as well as three, <code>x</code>,<code>y</code>and<code>z</code>.<br>\nIf <code>z</code> is present, <code>x</code> and <code>y</code> must be of integer types, and y must be non-negative.</p>\n<h2>Return</h2>\n<p>If <code>z</code> is present it returns <code>x</code> to the power <code>y</code> modulo <code>z</code>.If only <code>x</code> and <code>y</code> are present it returns <code>x</code> to the power <code>y</code> (same as x**y).</p>\n<h2>Example</h2>\n<pre><code>print(pow(2,4))    # prints 16\nprint(pow(10,-2))  # prints 0.01\nprint(pow(4,3,5))  # prints 4\n</code></pre>\n<p><img src="//forum.freecodecamp.com/images/emoji/emoji_one/rocket.png?v=2" alt=":rocket:" title=":rocket:"> <a href="https://repl.it/CTGi">Run Code</a></p>\n<p><a href="https://docs.python.org/3/library/functions.html#pow">Official Documentation</a></p>',frontmatter:{title:"Python Powxy",parent:"/home/stuart/guides/src/pages/articles/python/python-powxy/index.md absPath of file"}}},pathContext:{slug:"/articles/python/python-powxy/"}}}});
